var title_f34_52_35657="Schistocytes on peripheral smear";
var content_f34_52_35657=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F70851%7EHEME%2F50715&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F70851%7EHEME%2F50715&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Peripheral smear in microangiopathic hemolytic anemia showing presence of schistocytes",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 370px; height: 249px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Peripheral blood smear from a patient with a microangiopathic hemolytic anemia with marked red cell fragmentation. The smear shows multiple helmet cells (small black arrows), other fragmented red cells (large black arrow); microspherocytes are also seen (blue arrows). The platelet number is reduced; the large platelet in the center (red arrow) suggests that the thrombocytopenia is due to enhanced destruction.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carola von Kapff, SH (ASCP).",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal peripheral blood smear",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 393px; height: 257px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    High power view of a normal peripheral blood smear. Several platelets (black arrows) and a normal lymphocyte (blue arrow) can also be seen. The red cells are of relatively uniform size and shape. The diameter of the normal red cell should approximate that of the nucleus of the small lymphocyte; central pallor (red arrow) should equal one-third of its diameter.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carola von Kapff, SH (ASCP).",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 481px\">",
"   <div class=\"ttl\">",
"    Helmet cells in microangiopathic hemolytic anemia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 461px; height: 287px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Peripheral smears from two patients with microangiopathic hemolytic anemia, showing a number of red cell fragments (i.e., schistocytes), some of which take the form of combat (red arrow), bicycle (thick black arrow), or football (blue arrow) \"helmets.\" Microspherocytes are also seen (thin black arrows), along with a nucleated red cell (green arrow).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carola von Kapff, SH (ASCP).",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
