var title_f34_52_35659="Secretion clearance methods";
var content_f34_52_35659=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F78373&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F78373&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Secretion clearance/bronchial hygiene",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Technique",
"       </td>",
"       <td class=\"subtitle1\">",
"        Advantages",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comment/disadvantage",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Directed cough",
"       </td>",
"       <td>",
"        Inexpensive, simple",
"       </td>",
"       <td>",
"        Chest pain may limit",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Regular exercise",
"       </td>",
"       <td>",
"        Inexpensive, strengthens respiratory and peripheral muscles",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Autogenic breathing",
"       </td>",
"       <td>",
"        Controls breathing",
"       </td>",
"       <td>",
"        Requires patient cooperation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Forced expiration",
"       </td>",
"       <td>",
"        Helps control breathing",
"       </td>",
"       <td>",
"        Requires patient learning",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chest physical therapy (CPT) (postural drainage, hand, or mechanical chest clapping)",
"       </td>",
"       <td>",
"        Most tested in cystic fibrosis",
"       </td>",
"       <td>",
"        Needs assistant, hard to position, hypoxemia, sometimes worsens gastroesophageal reflux",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Positive expiratory pressure (PEP)",
"       </td>",
"       <td>",
"        Easy, inexpensive",
"       </td>",
"       <td>",
"        Device needs cleaning",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Oscillatory PEP (eg, flutter valve acapella device)",
"       </td>",
"       <td>",
"        Easy, inexpensive, adds vibration to airways",
"       </td>",
"       <td>",
"        Device needs cleaning",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        High frequency chest wall compression",
"       </td>",
"       <td>",
"        Better tolerated than chest PT",
"       </td>",
"       <td>",
"        Very expensive, pain may limit",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
