var title_f34_52_35660="Classification of primary esophageal motility abnormalities";
var content_f34_52_35660=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F64858&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F64858&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Classification of primary esophageal motility abnormalities",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Diagnosis",
"       </td>",
"       <td class=\"subtitle1\">",
"        Conventional manometry",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        <strong>",
"         Achalasia (the true disorder)",
"        </strong>",
"       </td>",
"       <td>",
"        Absent distal peristalsis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Incomplete LES relaxation (residual pressure &gt;8 mmHg)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Elevated resting LES pressure (&gt;45 mmHg)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Abnormal motility patterns (nonspecific esophageal dysmotility)*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"2\">",
"        Discoordinated motility",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" rowspan=\"4\">",
"        Diffuse (or distal) esophageal spasm",
"       </td>",
"       <td>",
"        Simultaneous contractions (&ge;20 percent wet swallows)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Intermittent peristalsis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Repetitive contractions (&ge;3 peaks)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Prolonged duration contractions (&gt;6 sec)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"2\">",
"        Hypercontracting esophagus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" rowspan=\"2\">",
"        Hypertensive peristalsis (\"nutcracker esophagus\")",
"       </td>",
"       <td>",
"        Increased distal peristaltic amplitude (mean value &gt;220 mmHg)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Increased distal peristaltic duration (mean value &gt;6 sec)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" rowspan=\"2\">",
"        Hypertensive LES",
"       </td>",
"       <td>",
"        Resting LES pressure &gt;45 mmHg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        May be incomplete LES relaxation (residual pressure &gt;8 mmHg)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"2\">",
"        Hypocontracting esophagus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" rowspan=\"2\">",
"        Ineffective esophageal motility (IEM)",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        Increased low amplitude peristalsis (&ge;50 percent wet swallows)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Low distal peristaltic amplitude (&lt;30 mmHg)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Hypotensive LES",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        Resting LES pressure &lt;10 mmHg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" rowspan=\"3\">",
"        Others",
"       </td>",
"       <td>",
"        Retrograde contractions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Triple peaked contractions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Isolated incomplete LES relaxation (&gt;8 mmHg)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     LES: lower esophageal sphincter.",
"     <br>",
"      * Defined as exceeding two standard deviations from mean of normal values.",
"      <br>",
"       <span class=\"bullet\">",
"        &bull;",
"       </span>",
"       May be \"secondary\" to gastroesophageal reflux disease (GERD).",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
