"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T1",
"      </td>",
"      <td colspan=\"3\">",
"       Tumor 2 cm or less in greatest dimension without extraparenchymal extension*",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T2",
"      </td>",
"      <td colspan=\"3\">",
"       Tumor more than 2 cm but not more than 4 cm in greatest dimension without extraparenchymal extension*",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
