"   <div class=\"lgnd\">",
"    The major salivary glands include the parotid, submandibular, and sublingual glands. Tumors arising in minor salivary glands (mucus-secreting glands in the lining membrane of the upper aerodigestive tract) are staged according to the anatomic site of origin (eg, oral cavity, sinuses, etc).",
